var title_f40_18_41259="Etiology of diastolic dysfunction";
var content_f40_18_41259=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F55751&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F55751&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Physiologic mechanisms and causes of diastolic dysfunction",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <colgroup span=\"3\" width=\"33%\">",
"     </colgroup>",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Physiologic abnormality",
"       </td>",
"       <td class=\"subtitle1\">",
"        Alteration in parameter of assessment",
"       </td>",
"       <td class=\"subtitle1\">",
"        Common etiology",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td>",
"        Abnormal (delayed or incomplete) relaxation",
"       </td>",
"       <td>",
"        <p>",
"         Increased tau",
"        </p>",
"        <p>",
"         Increased IVRT",
"        </p>",
"       </td>",
"       <td>",
"        <p>",
"         LV hypertrophy",
"        </p>",
"        <p>",
"         Myocardial ischemia",
"        </p>",
"        <p>",
"         LV dyssynchrony",
"        </p>",
"        <p>",
"         Abnormal loading",
"        </p>",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td>",
"        Early diastolic filling abnormalities",
"       </td>",
"       <td>",
"        <p>",
"         Reduced peak filling rate",
"        </p>",
"        <p>",
"         Increased time to peak filling",
"        </p>",
"       </td>",
"       <td>",
"        Abnormal relaxation (see above)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Increased LV passive stiffness",
"       </td>",
"       <td>",
"        <p>",
"         Abnormal diastolic P/V relationship",
"        </p>",
"        <p>",
"         Increased stiffness constant",
"        </p>",
"       </td>",
"       <td>",
"        <p>",
"         Concentric LVH",
"        </p>",
"        <p>",
"         Increased collagen and fibrosis",
"        </p>",
"        <p>",
"         Myocardial infiltration (eg, amyloid)",
"        </p>",
"        <p>",
"         Increased vascular turgor",
"        </p>",
"        <p>",
"         Post myocardial infarction hypertrophy and fibrosis",
"        </p>",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     LV: left ventricular; tau: time constant of isovolumic pressure decay; IVRT: isovolumic relaxation time; abnormal diastolic pressure/volume relationship: upward shift and/or increased slope of LV diastolic pressure/volume relationship.",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
